osStatus_t osSemaphoreAcquire (osSemaphoreId_t semaphore_id, uint32_t timeout) {#ifdef CUBE_MX_COMPILE
  SemaphoreHandle_t hSemaphore = (SemaphoreHandle_t)semaphore_id;
  osStatus_t stat;
  BaseType_t yield;
  stat = osOK;
  if (hSemaphore == NULL) {    stat = osErrorParameter;
  }
  else if (IS_IRQ()) {    if (timeout != 0U) {      stat = osErrorParameter;
    }
    else {      yield = pdFALSE;
      if (xSemaphoreTakeFromISR (hSemaphore, &yield) != pdPASS) {        stat = osErrorResource;
      } else {        portYIELD_FROM_ISR (yield);
      }
    }
  }
  else {    if (xSemaphoreTake (hSemaphore, (TickType_t)timeout) != pdPASS) {      if (timeout != 0U) {        stat = osErrorTimeout;
      } else {        stat = osErrorResource;
      }
    }
  }
  return (stat);
#else
  return osOK;
#endif}
