osStatus_t osSemaphoreRelease (osSemaphoreId_t semaphore_id) {#ifdef CUBE_MX_COMPILE
  SemaphoreHandle_t hSemaphore = (SemaphoreHandle_t)semaphore_id;
  osStatus_t stat;
  BaseType_t yield;
  stat = osOK;
  if (hSemaphore == NULL) {    stat = osErrorParameter;
  }
  else if (IS_IRQ()) {    yield = pdFALSE;
    if (xSemaphoreGiveFromISR (hSemaphore, &yield) != pdTRUE) {      stat = osErrorResource;
    } else {      portYIELD_FROM_ISR (yield);
    }
  }
  else {    if (xSemaphoreGive (hSemaphore) != pdPASS) {      stat = osErrorResource;
    }
  }
  return (stat);
#else
  return osOK;
#endif}
osThreadId_t osThreadNew (osThreadFunc_t func, void *argument, const osThreadAttr_t *attr) {#ifdef CUBE_MX_COMPILE
  const char *name;
  uint32_t stack;
  TaskHandle_t hTask;
  UBaseType_t prio;
  int32_t mem;
  hTask = NULL;
  if (!IS_IRQ() && (func != NULL)) {    stack = configMINIMAL_STACK_SIZE;
    prio  = (UBaseType_t)osPriorityNormal;
    name = NULL;
    mem  = -1;
    if (attr != NULL) {      if (attr->name != NULL) {        name = attr->name;
      }
      if (attr->priority != osPriorityNone) {        prio = (UBaseType_t)attr->priority;
      }
      if ((prio < osPriorityIdle) || (prio > osPriorityISR) || ((attr->attr_bits & osThreadJoinable) == osThreadJoinable)) {        return (NULL);
      }
      if (attr->stack_size > 0U) {        
        
        stack = attr->stack_size / sizeof(StackType_t);
      }
      if ((attr->cb_mem    != NULL) && (attr->cb_size    >= sizeof(StaticTask_t)) &&
          (attr->stack_mem != NULL) && (attr->stack_size >  0U)) {        mem = 1;
      }
      else {        if ((attr->cb_mem == NULL) && (attr->cb_size == 0U) && (attr->stack_mem == NULL)) {          mem = 0;
        }
      }
    }
    else {      mem = 0;
    }
    if (mem == 1) {      #if (configSUPPORT_STATIC_ALLOCATION == 1)
        hTask = xTaskCreateStatic ((TaskFunction_t)func, name, stack, argument, prio, (StackType_t  *)attr->stack_mem,
                                                                                      (StaticTask_t *)attr->cb_mem);
      #endif
    }
    else {      if (mem == 0) {        #if (configSUPPORT_DYNAMIC_ALLOCATION == 1)
          if (xTaskCreate ((TaskFunction_t)func, name, (uint16_t)stack, argument, prio, &hTask) != pdPASS) {            hTask = NULL;
          }
        #endif
      }
    }
  }
  return ((osThreadId_t)hTask);
#else
  return ((osThreadId_t)0x00);
#endif}
