void Task_Read(void *argument) {  bool gpio_pin[2] = {false, false};        
  for(;;) {    gpio_pin[1] = gpio_pin[0];
    gpio_pin[0] = HAL_GPIO_ReadPin(GPIO_RD_PORT, GPIO_RD_PIN);
    if(gpio_pin[0] != gpio_pin[1]) {      gpio_input_ct++;
    }
    osDelay(RD_LOOP_DELAY_CTS);
  }}
void Task_Write(void *argument) {  for(;;) {    if(gpio_input_ct > 0) {      gpio_input_ct--;
      osSemaphoreAcquire(gpio_inHandle, osWaitForever);
      HAL_GPIO_TogglePin(GPIO_WR_PORT, GPIO_WR_PIN);
      osSemaphoreRelease(gpio_inHandle);
    }
    osDelay(WR_LOOP_DELAY_CTS);
  }}
void Error_Handler(void) {  __disable_irq();
  for(;;);}
